import React, { Component } from 'react';

class Drinformation extends Component {
    constructor(props) {
        super(props);
        this.state = {
            doctors: [],
            isLoaded: false,


        };
    }


    componentDidMount() {
        fetch('https://api.betterdoctor.com/2016-03-01/doctors?user_key=ff5d654bef674612132ad54458bfb6a5&location=37.773,-122.413,100')
            .then(res => res.json())
            .then(doctors => {


                const locations = doctors.data.map( doctor => {

                    return { lat: doctor.practices[0].lat , lon: doctor.practices[0].lon }
                })
                console.log(locations)

            })
            .catch(error => console.log(error))
    }
    render() {
        return (
            <div>

            </div>
        );
    }
}

export default Drinformation;
